import React from 'react';

const SideBar = () => {
  return (
    <>
      <div class="dropdown">
        <img src="/images/SideBar.png" data-toggle="dropdown" alt="" height="40px" width="30px" className="SideBar" />
        <div class="dropdown-content">
          <a href="#">Link 1</a>
          <a href="#">Link 2</a>
          <a href="#">Link 3</a>
        </div>
      </div>
    </>
  );
};

export default SideBar;
